import React, { Component } from 'react'
import { Link,Rou } from 'react-router-dom'
export default class Message extends Component {
    state = {
        message: [{
            id: '01',
            title: 'message1',
            content: ' react params传参'
        }, {
            id: '02',
            title: 'message2',
            content: ' react seach传参'
        }, {
            id: '03',
            title: 'message3',
            content: ' react params传参'
        }]
    }
    render() {
        const { message } = this.state
        return (
            <ul>
                {
                    message.map((obj) => {
                        return (
                            <li key={obj.id}>
                                <Link to={`/home/message/${obj.id}/${obj.title}`}> {obj.title}</Link>
                            </li>
                        )
                    })
                }
            </ul>

        )
    }
}
